import React from "react";
import "./ToolTip.css"; // Style your tooltips

const ToolTip = ({ children, tooltipContent }) => {
  return (
    <div className="tooltip-container">
      {children}
      <div className="tooltip-content">{tooltipContent}</div>
    </div>
  );
};

export default ToolTip;
